import React from "react";
import {Button ,Box, Typography, makeStyles} from "@material-ui/core"
const GroceryItem = ({
  id,
  product_name,
  stock_available,
  quantity,
  price,
}) => {


    const useStyles = makeStyles({
        div:{
           border:"1px solid blue" ,
           width: "300px",
           margin:"50px",
           padding:"20px",

        }
    })
    const random =()=>{
        return `rgb(${Math.random()*255},${Math.random()*255},${Math.random()*255})`
    }
    let classes = useStyles()
    let background = random()
  return (
    <div style={{display:"flex", flexWrap:"wrap", justifyContent:"center"}}>
        <Box color="text.primary" className = {classes.div} style={{background}}>
        <Typography variant="h6">Product Name : {product_name} </Typography>

      <Typography> Quantity : {quantity}</Typography>
      <Typography> Price : {price}</Typography>
      <Button variant="contained" color="primary" >
        {stock_available ? "Stock Available" : "Stock Not Aavilable"}
      </Button>
</Box>

    </div>
  );
};

export {GroceryItem}
